// src/components/AboutMe.js
import React from "react";
import { FaGithub, FaLinkedin, FaEnvelope, FaProjectDiagram, FaBriefcase, FaUsers } from "react-icons/fa";
import { motion } from "framer-motion";

// Animation variants
const containerVariants = {
  hidden: { opacity: 0 },
  show: { opacity: 1, transition: { staggerChildren: 0.2 } }
};
const itemVariants = {
  hidden: { opacity: 0, y: 20 },
  show: { opacity: 1, y: 0 }
};

export default function AboutMe() {
  return (
    <section id="about" className="relative bg-gradient-to-br from-indigo-900 via-purple-900 to-black py-24 px-6">
      {/* Decorative floating shapes */}
      <div className="absolute top-8 left-4 w-24 h-24 bg-purple-700 opacity-20 rounded-full animate-pulse mix-blend-lighten"></div>
      <div className="absolute bottom-16 right-8 w-32 h-32 bg-pink-600 opacity-20 rounded-full animate-pulse mix-blend-lighten"></div>

      <motion.div
        className="max-w-5xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-10 items-center"
        variants={containerVariants}
        initial="hidden"
        whileInView="show"
        viewport={{ once: true, amount: 0.3 }}
      >
        {/* Photo with hover effect */}
        <motion.div variants={itemVariants} className="flex justify-center">
          <motion.img
            src="/profile.jpg"
            alt="Yassine Chmirrou"
            className="w-56 h-56 rounded-full border-4 border-white shadow-lg object-cover"
            whileHover={{ scale: 1.05, rotate: [0, 2, -2, 0] }}
            transition={{ duration: 0.6 }}
          />
        </motion.div>

        {/* Text and stats */}
        <div className="space-y-6">
          <motion.h2
            variants={itemVariants}
            className="text-4xl md:text-5xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-indigo-400 via-pink-500 to-purple-500"
          >
            Yassine Chmirrou
          </motion.h2>

          <motion.p variants={itemVariants} className="text-gray-300 leading-relaxed text-lg">
            Final-year AI & Big Data Engineering student at ENSA TÃ©touan. I build scalable data pipelines,
            train deep learning models, and create insightful visualizations to drive impactful decisions.
          </motion.p>

          {/* Stats cards */}
          <motion.div
            variants={itemVariants}
            className="grid grid-cols-3 gap-4 text-center"
          >
            <div className="bg-white/10 backdrop-blur-md border border-white/20 rounded-xl p-4">
              <FaProjectDiagram className="mx-auto text-2xl text-blue-400 mb-2" />
              <span className="block text-xl font-semibold text-white">3+</span>
              <span className="text-sm text-gray-300">Projects</span>
            </div>
            <div className="bg-white/10 backdrop-blur-md border border-white/20 rounded-xl p-4">
              <FaBriefcase className="mx-auto text-2xl text-blue-400 mb-2" />
              <span className="block text-xl font-semibold text-white">1</span>
              <span className="text-sm text-gray-300">Internship</span>
            </div>
            <div className="bg-white/10 backdrop-blur-md border border-white/20 rounded-xl p-4">
              <FaUsers className="mx-auto text-2xl text-blue-400 mb-2" />
              <span className="block text-xl font-semibold text-white">5</span>
              <span className="text-sm text-gray-300">Workshops</span>
            </div>
          </motion.div>

          {/* Social links */}
          <motion.div variants={itemVariants} className="flex space-x-6 justify-center md:justify-start text-2xl text-white">
            <a href="https://github.com/YassineChmirrou" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400 transition-transform transform hover:scale-110">
              <FaGithub />
            </a>
            <a href="https://linkedin.com/in/yassinechmirrou" target="_blank" rel="noopener noreferrer" className="hover:text-blue-400 transition-transform transform hover:scale-110">
              <FaLinkedin />
            </a>
            <a href="mailto:yassinechmirrou1@gmail.com" className="hover:text-blue-400 transition-transform transform hover:scale-110">
              <FaEnvelope />
            </a>
          </motion.div>
        </div>
      </motion.div>
    </section>
  );
}
